import React from 'react';

import './RealDetail.css';
import { connect } from 'react-redux'

class RealDetail extends React.Component {
  render() {
    if (this.props.match) {
      console.log(this.props.match.params.id);
    }
    return (
      < div className="RealDetail" >
        <div className="row">
          <div className="left">
            Name:
        </div>
          <div className="right">
            {this.props.title}
          </div>
        </div>

        <div className="row">
          <div className="left">
            Content:
        </div>
          <div className="right">
            {this.props.content}
          </div>
        </div>
      </div >
    );
  }
};

export default RealDetail;
